import { navbarLinks as link } from '../../NavigationMenu'




const Nav = (props) => {
    return (
        <nav className="flex  items-center w-full h-[5em]  text-block   font-mono navbar  text-[#ffff] ">
            <div className="logo">
                <Link href=''>
                    <h2 className="text-2xl text-[#ffff]">ğ–’ğ–”ğ–ğ–ğ–Šğ–šğ–˜</h2>
                </Link>
            </div>

            <div className="md:flex  mt-[8px] hidden">

                <div className="space-x-4 ml-[20em] orderlist">
                    {link.map((nav) => {
                        const { id, text, path } = nav;
                        return (

                            <Link as={`/${nav.path}`} href='/[pages]'>

                                <a>{text}</a>
                            </Link>

                        )
                    })}
                </div>

            </div>

            <button className="ml-80">Connect to Us</button>

        </nav>
    )
}


export default Nav
